from keras.models import Sequential
from keras.layers import Dense, Flatten, Dropout, LSTM

# model declaration
def createModel(n_timesteps, n_features):   # , n_outputs
  model = Sequential()
  model.add(LSTM(100, input_shape=(n_timesteps,n_features)))
  model.add(Dropout(0.5))
  model.add(Dense(100, activation='relu'))
  # model.add(Dense(n_outputs, activation='softmax'))
  model.add(Dense(2, activation='softmax'))   # 2 possible classes (0 - no, 1 - yes)

  # model.compile(loss='categorical_crossentropy', optimizer='adam', metrics=['accuracy'])
#   model.compile(loss='sparse_categorical_crossentropy', optimizer='adam', metrics=['accuracy'])
  model.compile(loss='mean_squared_error', optimizer='adam', metrics=['accuracy'])

  # chaged loss because of this ERROR
  #   ValueError: You are passing a target array of shape (7, 1) while using as loss `categorical_crossentropy`. `categorical_crossentropy` expects targets to be binary matrices (1s and 0s) of shape (samples, classes). If your targets are integer classes, you can convert them to the expected format via:
  # ```
  # from keras.utils import to_categorical
  # y_binary = to_categorical(y_int)
  # ```

  # Alternatively, you can use the loss function `sparse_categorical_crossentropy` instead, which does expect integer targets.

  return model

# fit and evaluate a model
def evaluate_model(trainX, trainy, testX, testy, round):
  verbose = 0
  epochs = 30
  batch_size = 64

  n_timesteps = trainX.shape[1]
  n_features = trainX.shape[2]
  # n_outputs = trainy.shape[1]
  # n_outputs = 1    # we know for sure that it's singular

  #print("STEPS: ", trainX.shape[1], ", FEATURES: ", trainX.shape[2], ", OUTPUTS: ", trainy.shape[1])

  model = createModel(n_timesteps, n_features)    # , n_outputs
  
  # fit network
  model.fit(trainX, trainy, epochs=epochs, batch_size=batch_size, verbose=verbose)
  
  # evaluate model
  _, accuracy = model.evaluate(testX, testy, batch_size=batch_size, verbose=0)
  
  # save model as .h5
  model.save(f'{MODEL_PATH}/model-round-{round}.h5')
  
  return accuracy

# summarize scores
def summarize_results(scores):
  print(scores)
  m, s = mean(scores), std(scores)
  print('Accuracy: %.3f%% (+/-%.3f)' % (m, s))

